import './Techs.css';
import React from 'react';

function Techs() {
  return (
    <section className='techs'>
      <div className='techs__container'>
        <h2 className='about-project__title'>Технологии</h2>
        <hr className='about-project__divider' />
      </div>
    </section>
  );
}

export default Techs;
